import Auth from "@/models/Auth";
import axios from "axios";

export default (to, from, next) => {
  axios.get('validate-token').catch(function (error) {
    if (error.response) {
      console.log(error.response.status);
      if (error.response.status === 401) {
        next({ name: 'login' });
      }
    }
  });
}
